import React, { Component } from 'react';
import { Switch, Route } from 'react-router-dom';
import Receipt from './Components/ReceiptView/Receipt';
import GroupImage from './Components/groupImage/GroupImage';
import Chat from '../Chat/Chat'

class NewHome extends Component {
render() {

const testFunc = () => {
console.log(this.props.currentUser)
}

return (
<div>
{/* <Chat currentUser={this.props.currentUser} chatID={this.props.currentUser.currentTrip}/> */}
<Switch>

          <Route
            exact
            path="/home/receipt"
            component={(props) => <Receipt {...props} currentUser={this.state.currentUser}/>}
          />
          <Route
            exact
            path="/home/image"
            component={(props) => <GroupImage {...props} currentUser={this.state.currentUser}/>}
          />

        </Switch>
</div>
);
}
}

export default NewHome;
